relativeFreqArray = [6.54, 6.93, 7.34, 7.78, 8.18, 8.66, 9.18, 9.72, 10.3, 10.91, 11.56, 12.25, 12.98];

%% Specify that pitch vector of 1 corresponds to most likely that note in chromatic scale from C to C
target_value = 1;

%% Extract the locations of pitch vectors of 1 and connect them to their corresponding note in Hz
all_corresponding_Freqs = [];
for i = 1:length(experienceData)
    pitches = experienceData(i).pitches;
    indices = find(pitches == target_value);
    if ~isempty(indices)
        for j = 1:length(indices)
            if indices(j) <= length(correspondingFreqArray)
                all_corresponding_Freqs = [all_corresponding_Freqs, correspondingFreqArray(indices(j))];
            end
        end
    end
end

%% Extract the locations of RELATIVE pitch vectors of 1 and connect them to their corresponding note in Hz
all_relative_Freqs = [];
for i = 1:length(experienceData)
    pitches = experienceData(i).pitches;
    indices = find(pitches == target_value);
    if ~isempty(indices)
        for j = 1:length(indices)
            if indices(j) <= length(relativeFreqArray)
                all_relative_Freqs = [all_relative_Freqs, relativeFreqArray(indices(j))];
            end
        end
    end
end

%% Extract the starting times of each pitch and amplitude segment
% Extract the maximum amplitude values of each segment
% Convert from -60 to 0 dB range to 0 to 255 ring brightness range
start_values = [];
loudness_max_values = [];
adjusted_loudness_max_values = [];

for i = 1:length(experienceData)
    start_values = [start_values, experienceData(i).start];
    start_values_mins = start_values / 60;
    loudness_max_values = [loudness_max_values, experienceData(i).loudness_max];
    adjustment_value = (experienceData(i).loudness_max + 60) * 255 / 60;
    adjusted_loudness_max_values = [adjusted_loudness_max_values, adjustment_value];
end

%% Now we're ready to use our arrays all_corresponding_Freqs, all_relative_Freqs, start_values and loudness_max_values

% Determine the length of start_values
n = length(start_values);

% Truncate all_corresponding_Freqs to the same length as start_values
truncated_Freqs = all_corresponding_Freqs(1:n);

% Truncate all_relative_Freqs to the same length as start_values
truncated_relatives = all_relative_Freqs(1:n);

% Perform the concatenation
frequencyAtTimes = [start_values', truncated_Freqs'];

% Perform the concatenation for the relative perfect third
relativeAtTimes = [start_values', truncated_relatives'];

frequencyInterpMethod = 'nearest'; % nearest makes it square

ringBrightness = 255; % max brightness

centralBrightnessAtTimes = [start_values_mins',adjusted_loudness_max_values'];

brightnessInterpMethod = 'linear'; 

frameDurationS = (1/2000); % Time duration of each frame
sampleTimes = (0:frameDurationS:durationSeconds- frameDurationS)'; % Generate a list sample timestamps

frequencyValues = interp1(frequencyAtTimes(:,1), frequencyAtTimes(:,2), sampleTimes, frequencyInterpMethod); % Interpolate the current frequency for each of the sample times
relativeFrequencyValues = interp1(relativeAtTimes(:,1), relativeAtTimes(:,2), sampleTimes, frequencyInterpMethod); % Interpolate the current RELATIVE frequency for each of the sample times

avgFreqSinceStart = cumsum(relativeFrequencyValues) ./ (1:length(relativeFrequencyValues))'; % Calculate the average frequency since the start for each sample time

strobeDutyCycle = 50;

strobe = (1 + square(sampleTimes * 2 * pi .* avgFreqSinceStart, strobeDutyCycle)) ./ 2; % Generate strobe waveform for each of the sample times (and shift to be 0-1-0-1)

ledONBitmap = binary8ToUint8(repmat(strobe, 1, 8)); % Use the strobe signal to turn on and off the ring LED states

centralBrightness = round(interp1(centralBrightnessAtTimes(:,1), centralBrightnessAtTimes(:,2), sampleTimes / 60, brightnessInterpMethod)); % Interpolate brightness for the central LED

dacChannelValuesPerSample = [centralBrightness, repmat([ringBrightness, ringBrightness, ringBrightness, ringBrightness], [length(sampleTimes), 1])]; % Varying central brightness, constant ring brightness, repeat ring values for every generated sample

preparedStrobeData2D = [ledONBitmap, dacChannelValuesPerSample]; % Join bitmap with dac channels
preparedStrobeData1D = reshape(preparedStrobeData2D', [size(preparedStrobeData2D, 1) * size(preparedStrobeData2D, 2), 1])'; % convert to 1D array

